import React from 'react'
import Style from "./home.module.css";
import CalendarIcon from "../../assets/svg/calendarIcon.svg";
import HomeCard from '../../components/homeCards/HomeCard';
import MobileDatePicker from '@mui/lab/MobileDatePicker';


function Home() {
   const [value, setValue] = React.useState(new Date('2014-08-18'));

  const handleChange = (newValue) => {
    setValue(newValue);
  };
   return (
      <>
         <div className="topHeading">
            <div className={`d-flex justify-content-between align-items-center`}>
               <div>Home</div>

               <MobileDatePicker
                  value={value}
                  onChange={handleChange}
                  renderInput={(params) => <img src={CalendarIcon} alt="calendarIcon" />}
               />
            </div>
         </div>
         <div className={Style.homeSticky}>
            <div className={Style.homeStickyWrapper}>
               <div className={Style.leftText}>Q<sub>1</sub></div>
               <div className={Style.rightText}>Car wash</div>
            </div>
         </div>
            <HomeCard />
            <HomeCard />
            <HomeCard />
            <HomeCard />
      </>
   )
}

export default Home
